import {RedButton, GreenButton, BlueButton} from "./Components/Button.style";

function App() {
  return (
    <div className="App">
      <RedButton>Hello</RedButton>
      <GreenButton>Hello</GreenButton>
      <BlueButton>Hello</BlueButton>
    </div>
  );
}

export default App;
